import React from 'react';
import { Outlet, NavLink } from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHouse, faChartLine, faPlus, faCirclePlus } from '@fortawesome/free-solid-svg-icons'
import './App.css'

function App() {
  const navStyle = {
    marginRight: '5%',
    width: '50px'
  }
  return (
    <div>
      <header>
        <div>
          <h1>SebMedia</h1>
        </div>
        <div>
          <NavLink to="home" style={navStyle}>
            <FontAwesomeIcon icon={faHouse}/>
          </NavLink>
          <NavLink to="dashboard" style={navStyle}>
            <FontAwesomeIcon icon={faChartLine}/>
          </NavLink>
          <NavLink to="posts" style={navStyle}>
            {({isActive}) => (
              isActive ? <FontAwesomeIcon icon={faCirclePlus} style={navStyle}/> : <FontAwesomeIcon icon={faPlus} style={navStyle}/>
            )}
          </NavLink>
        </div>
      </header>
      <Outlet/>
    </div>
  );
}

export default App;
